import { MDBContainer, MDBRow, MDBBtn} from "mdb-react-ui-kit";
import { TextField } from "@mui/material";
import useAxiosPrivate from "../hooks/useAxiosPrivate";
import axios from "axios";

function Search(props) {

  const axiosInstance = useAxiosPrivate()

  const [query, setQuery] = useState("")

  useEffect(()=> {
    console.log(query)
  }, [query])

  function handleSearch(query) {
    axiosInstance.get('transactions/?search=' + query).then((res) => {
      console.log(res)
    })

  }

  return (
    <div>
      <MDBContainer>
      <MDBRow>
        <h3>Suche</h3>
      </MDBRow>
      <MDBRow>
        <TextField
            className="mb-3"
            sx={{ minWidth: 550, maxWidth: 550 }}
            id="suchbegriff"
            name="suchbegriff"
            label="Suchbegriff"
            variant="outlined"
            onChange={(event) => setQuery(event.target.value)}
          />

          <MDBBtn
                className="btn-close"
                color="none"
                onClick={handleSearch}
          ></MDBBtn>
      </MDBRow>

        <h5>
          Suche nach Auftr√§gen/Partnern: <i>{query}</i>
        </h5>
      </MDBContainer>
    </div>
  );
}

export default Search;
